  const handelChange = (e) =>{
    setUsername(e.target.value)
    setPassword(e.target.value)
  }
  const handelPost = () =>{
    const Data = {username, password}
    setUserData(Data)
  }
  return(
    <form method='POST'>
      <TextField value={username} onChange={handelChange} label="enter something" variant="standard" />
      <TextField value={password} onChange={handelChange} label="enter something" variant="standard" />
      <Button variant='contained' onClick={handelPost}> + </Button>

    </form>
  )
}
